import React from 'react';
import Card from 'react-bootstrap/Card';
import './stil.css';
class Home extends React.Component {
  render() {
    return (
      <div className="main-div">
            <Card style={{ width: '55rem' }} id="prva">
              <Card.Body>
                <Card.Title id="naslov">Welcome to the synonyms search tool</Card.Title>
                <Card.Text >
                  Add your own synonyms

                </Card.Text>
                <Card.Text >
                  Search synonyms
                  
                </Card.Text>
              </Card.Body>
            </Card>
      </div>
    );
  }
}

export default Home;
